import useFetchData from "../apiFetches/FetchData";
import { RedirectButton } from "../components/generics/RedirectButton";
import UserCard from "../components/user/UserCard";

const Repositories = ({ repos_url }) => {
  const apiData = useFetchData(`/users/${user}`);
  //Extract only what is required
  const { avatar_url, login } = apiData.data;

  return (
    <>
      <RedirectButton previousPage={"/"} />
      {apiData.loading ? (
        <div>Loading</div>
      ) : (
        <UserCard avatar={avatar_url} name={login} />
      )}
    </>
  );
};
export default Repositories;
